import Footer from '../../components/footer';
import './scss/tem.scss';
import TemCard from './Components/TemCard';
const Temoignages = ()=>{
    const FakeData = {
        Usrimg  : "https://firebasestorage.googleapis.com/v0/b/image-upload-test-7d968.appspot.com/o/images%2Ffirebase-image-1598462138996?alt=media&token=81458bbf-49b2-42d2-b7ea-00510b32f359",
        companyname : "testCompany",
        link : "https://www.youtube.com/watch?v=ERvtIGNl79c"
    }
    return (
      <>
        <div className="body">
          <div className="ContentInside">
            <Head title="Témoignages | 6 solutions" />
            <Header active="temoignages" />
            <div className="proposBody">
            
              <h1 className="title">Témoignages</h1>
              <div style={{display : 'flex',justifyContent : 'space-between',alignItems : 'baseline'}}>
                  <div className="tems"></div>
                  <div className="AddTem">
                    <input className="TemButton" type="button" value="Ajouter un témoignage" />
                  </div>
              </div>
              
              
              <div className="TemCards">
                <TemCard props={FakeData}/>
                <TemCard props={FakeData}/>
                <TemCard props={FakeData}/>
                <TemCard props={FakeData}/>
              </div>
            </div>
          </div>
        </div>
        <Footer />
      </>
    );
}
export default Temoignages ;
